import { call, put } from 'redux-saga/effects'
import { getList } from '../../actions/ListActions';
import { requestGetLists } from '../requests/lists';

export function* handleGetLists() {
    try{
        const response = yield call(requestGetLists);
        const { data } = response;
        yield put(getList([
            { _id:1, name:'ali'}, 
            { _id:2, name:'jamal'}]));
    }catch(err) {
        console.log(err);
    }
}
